import React from "react";
import styles from './styles.module.scss';

const Cart = ({
    cartItems = [
        {
            bookId: 1,
            availableQty: 3,
            bookName: 'BookName 1',
            imageUrl: 'https://res.cloudinary.com/abyy30/image/upload/v1608652378/bookImages/star.jpg',
            isSelected: false,
        }
    ]
}) => {
    return (
        <div className={styles.cart}>
            <div className={styles.cart__inner}>
                {cartItems.map(item => 
                    <div className={styles.cart__item}>
                        <img src={item.imageUrl} />
                    </div>
                )}
            </div>
        </div>
    )
}

export default Cart
